import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

import ClubsDropdown from './components/ClubsDropdown';
import Wheel from './components/Wheel';

function App() {

  const woodsAndHybrids = ['Driver', '3 Wood', '5 Wood', '1 Hybrid', '2 Hybrid', '3 Hybrid', '4 Hybrid', '5 Hybrid'];
  const irons = ['1', '2', '3', '4', '5'];
  const wedges = ['Gap', 'Lob', 'Trouble'];

  return (
    <div className="App">
      <ClubsDropdown clubs={woodsAndHybrids}/>
      <Wheel/>
    </div>
  );
};

export default App;
